script: |
  super -f tsv -I q1234.sql | sort > q1234.out

vector: true

inputs:
  - name: q1234.sql
    data: |
      SELECT ALL + + CAST ( col2 AS INTEGER ) FROM tab1 WHERE NOT - - col0 BETWEEN - 18 + + - col2 * - - 15 * col2 AND + + col1;
  - name: tab1

outputs:
  - name: q1234.out
    data: |
      59
      68
      96
